import React, {useState} from 'react';
import layer_cake from '../picture/layer-cake.jpg'
import birthday_cake from '../picture/birthday-cake.jpg'
import cup_cake from '../picture/cup-cake.jpg'


const cake_types = {
    layer_cake: layer_cake,
    birthday_cake: birthday_cake,
    cup_cake: cup_cake};

class Category extends React.Component{

    render(){

        let i = (this.props.type == 'layer-cake') ? "d":"s";

        return(
            <section>
                <img src={cake_types[this.props.type]} className="category-picture"/>
                <div>{i}</div>
                <div>{this.props.type}</div>
                <div className="category-desc">say something</div>
            </section>
        );
    }

}

export default Category;
